import logo from './logo.svg';
import './App.css';
import Home from './route/home'
import Signin from './route/signin'
import Signup from './route/signup'
import Products from './route/product'
import Laptop from './route/laptop'
import Mobile from './route/mobile'
import Homeappliances from './route/homeappliances'
import Fashion from './route/fashion'
import { BrowserRouter, Routes, Route } from "react-router-dom";

function App() {
  return (
    <BrowserRouter>
    <Routes>
    <Route path="/" element={< Home />}></Route>
    <Route path='/signin' element={< Signin />} ></Route>
      <Route path='/signup' element={< Signup />} ></Route>
      <Route path='/products' element={< Products />} ></Route>
      <Route path='/laptop' element={< Laptop />} ></Route>
      <Route path='/mobile' element={< Mobile />} ></Route>
      <Route path='/homeappliances' element={< Homeappliances />} ></Route>
      <Route path='/fashion' element={< Fashion />} ></Route>
    </Routes>
    </BrowserRouter>
  );
}

export default App;
